  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '会员状态，-1禁用，0未验证，1未同步微信资料，2已同步微信，3等待验证',
  `last_login_role` int(11) NOT NULL,
  `show_role` int(11) NOT NULL COMMENT '个人主页显示角色',
  `tagid_list` varchar(255) NOT NULL COMMENT '标签id',
